import React ,{ Component } from "react"
import Link from "next/link";


class Home extends Component{
    render()
    {
        return(
            <div>
                <h1>Hello Steritrack</h1>
                <Link href='/about'>
                    <a>About</a>
                </Link>
                <Link href='/blog'>
                    <a>Blog</a>
                </Link>
            </div>
        );
    }
}

export default Home;
